If you don't like what someone reviews then feel free to find some other use for your time, especially since you aren't articulating what exactly you are expecting them to review/showcase instead.

@gamersnexus
The "scent module" might be a variation on the "reed diffuser" which is commonly used for room scenting where an open flame is undesirable (ie. no candles).  A rattan reed basically acts like a porous wick to gradually evaporate scent oil from a bottle.  No heat or other power source is required, though a bit of airflow helps to circulate the scent.  A modest-sized bottle is supposed to last several months when used with about half a dozen reeds.
However, there is no visible source of scent oil in what Yeston have integrated.  I can only infer that they must have used a more concentrated form of the perfume, and soaked a reservoir enclosed within the module in the stuff.  Then the relatively small surface area of a single, shortened reed only needs to evaporate a small quantity of the perfume to be effective.  It's also noteworthy that much of the reed is also enclosed in a non-porous plastic sheath, which would further reduce the rate of evaporation (especially in the considerable airflow of a GPU under load).

